import React, { Component } from 'react'

export default class insertSingle extends Component {

    styleSheets = {
        main : {
            width : "100vw",
            height : "100vh",
            backgroundColor : "rgba(0,0,0,0.2)",
            position:"fixed",
            zIndex: 2
        },
        container : {
            width : 600,
            height : 400,
            backgroundColor : "#fff",
            position : "absolute",
            inset : 0,
            margin : "auto"
        },
        closeButton : {
            background : "transparent",
            border : "none",
            width : 30,
            height : 30,
            color : "#fff"
        }
    }


    render() {
        const { main,container,closeButton} = this.styleSheets



        return (
            <div style={main}>
                <button style={closeButton}><span className='material-symbols-outlined'>close</span></button>
                <div style={container}></div>
            </div>
        )
    }
}
